import React, { useEffect, useState } from "react";
import { Row, Col, Container } from "react-bootstrap";

const ListElem = (props) => {

    return (
        <>
        <Container>
            <p><b>{props.booking.userId.firstName}</b></p>
            <p>{props.booking.doctorId.name}</p>
            <p>{props.booking.serviceId.name}</p>
            <p>{props.booking.serviceId.price}</p>
        </Container>
        </>
    )

}

export default ListElem;
